import React from 'react';
import styled from 'styled-components';

const  Footer =  () => {

        const HeroWrapper = styled.div ` 
            background: #ccccff;
        `;

        const Equipo = styled.h1 `
            font-size: 25px;
            font-family: verdana, sans-serif;
            font-weight: 900;
            text-align: left;
            padding-left: 30px;
        `;

        const Integrantes = styled.h2 `
            font-size: 15px;
        `;

    return (
    <HeroWrapper>
        <row class="col-4"> 
            <Equipo>Equipo:</Equipo>
            <Integrantes>Mabe <br> </br> Fer <br></br> Mart Comito <br></br> Tomi D <br></br> irisS</Integrantes>
        </row> 
    </HeroWrapper>
    )
}

export default Footer;
